import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <div className="sidebar">
      <h2>Sidebar Menu</h2>
      <ul>
        <li><Link to="/">Home</Link></li>

      </ul>
    </div>
  );
};

export default Navbar;
